      <div className="lp">
          <img src="https://assets.pokemon.com/static2/_ui/img/og-default-image.jpeg" alt="" />
        <div>
          </div>
          <Link to="/home">
            <button className="button"> ENTER </button>
          </Link>
      </div>
   
    )
  }
